attrs.description:
Мы разработаем проект, который будет полностью соответствовать Вашим требованиям, целям и бюджету. В наше время стадии проектирования загородного дома уделяется не так много внимания, что может повлечь за собой неприятные последствия при строительстве или в процессе эксплуатации дома. Обращаясь к нам - Вы исключите эти риски.

Архитектурное Решение. В АР входит: 
общие данные Вашего дома (где прописываются: общая площадь, жилая площадь, 
площадь террас и балконов, тип фундамента, тип кровли); 
планы этажей с расстановкой мебели; 
фасады с обозначениями оконных и дверных проёмов;
разрез дома с указанием высотных отметок; 
план фундамента; 
план кровли; 
спецификация окон и дверей; 

Конструктивное Решение. В КР входит:
Архитектурное Решение;
лаги пола 1 этажа;
лаги перекрытия; 
план каркасных стоек 1 этажа;
план каркасных стоек 2 этажа;
развёртка каркасных стоек (стен);
стропильная система;
конструктивные узлы.
